w']=0,['Groups']=0,['EffectType']=5074,['Y']=52052,['Color']=939993,['Z']=74390.072839,['Roll']=0,['SizeZ']=260,['Contrast']=4,['SizeX']=123.664717,['X']=79062.563905,['SizeY']=260,['Alpha']=1,['Pitch']=4.712564,['MetaData']={['name']='Vine Willow Inn - Pool',['message']='The water here was cool, soothing. Something about it, relaxing and healing. One would sense spending time here would lead the body to recovering a bit more and a little faster than normal... There was more however... Something else that most would miss.. Something addictive about the waters...',},['Id']=1370,},[109]={['Yaw']=3.141593,['Groups']=0,['EffectType']=5074,['Y']=45341,['Color']=999999,['Z']=71129.069315,['Roll']=0,['SizeZ']=260,['Contrast']=4,['SizeX']=123.664717,['X']=78129.184174,['SizeY']=260,['Alpha']=1,['Pitch']=0,['MetaData']={['name']='Vine Willow Inn - Dreams',['message']='Any who dream here will wake to their dreams in reality. Twisted into the things they want. The best versions to lull them into a peaceful state of wanting to stay. To never leave. These things will reflect reality to a degree, but are not. They are different, ideal versions with added dream qualities. All around can interact with these dreams. The only thing the dreams ask for in return is that you stay. Don\\'t leave them and they will be with you forever...',},['Id']=1374,},[110]={['Yaw']=4.712389,['Groups']=0,['EffectType']=5074,['Y']=45907,['Color']=990096,['Z']=71011.830526,['Roll']=0,['SizeZ']=260,['Contrast']=1,['SizeX']=123.664717,['X']=77992.853112,['SizeY']=260,['Alpha']=1,['Pitch']=0,['MetaData']={['name']='Vine Willow Inn - Nightmares',['message']='Any who have nightmares here will have to face them if they try to leave. These things will do anything they can based on what they are to force you to stay. These things might at times reflect reality to a dagree, but are not memories. They are different, monsterous versions with nightmare qualities. All around can interact with these nightmares and the nightmares can interact with all. All these nightmares want, is for you to never leave. ',},['Id']=1375,},[111]={['Yaw']=1.570796,['Groups']=0,['EffectType']=5074,['Y']=55453,['Color']=990098,['Z']=69780.565828,['Roll']=0,['SizeZ']=260,['Contrast']=1,['SizeX']=123.664717,['X']=77386.957853,['SizeY']=260,['Alpha']=0,['Pitch']=0,['MetaData']={['name']='Vine Willow Inn - Roof',['message']='Slip, fall or jump off the roof and land out of bounds and you will find yourself in an inn bed trapped in a dream for a week before waking to broken limbs from a bad fall... ',},['Id']=1382,},[112]={['Yaw']=1.570796,['Groups']=0,['EffectType']=5074,['Y']=55337,['Color']=990099,['Z']=69687.230372,['Roll']=0,['SizeZ']=260,['Contrast']=1,['SizeX']=123.664717,['X']=80530.640832,['SizeY']=260,['Alpha']=0,['Pitch']=0,['MetaData']={['name']='Vine Willow Inn - Roof',['message']='Slip, fall or jump out of the roof and land out of bounds and you will find yourself in and inn bed trapped in a dream for a week before waking to broken limbs from a bad fall...',},['Id']=1383,},[113]={['Yaw']=4.712389,['Groups']=0,['EffectType']=5074,['Y']=54158,['Color']=990099,['Z']=74499.335344,['Roll']=0,['SizeZ']=260,['Contrast']=1,['SizeX']=123.664717,['X']=82475.898299,['SizeY']=260,['Alpha']=0,['Pitch']=0,['MetaData']={['name']='Vine Willow Inn',['message']='Yes... things past the Inn could be seen but... it was a dream. Step out of the safety of the Inn\\'s walls and, the dream would turn into a nightmare. It would keep you hours... days... maybe longer...  before letting you free again to wake up in one of the Inn\\'s beds. Broken from all your nightmares. Addicted to the Inn\\'s magic. Yes. You could go explore what was out there, but... there was no need. What was out there was what was already in the dark corners of your mind....',},['Id']=1385,},[114]={['Y']=47355,['EffectType']=558,['Yaw']=3.141593,['Color']=999979,['Z']=81204,['SizeY']=3000,['SizeZ']=3000,['Contrast']=1,['SizeX']=50000,['X']=79041