R["oh__@shadows_assassin"]="{['Key']='oh__@shadows_assassin',['Version']=1766,['TS']=1637146680,['na']={[72]={['O']=18948,['N']='Castle in the Clouds',['D']='Welcome to the Castle in the Clouds.\\n\\nCenturies ago a young and impaitent Altmer dreamed of fame and fourtune to win the respect of their peers in the Mages Guild. To acheive this they sought to make the grandest castle they could and raise it high into the sky. From it they would look down upon all those who had rejected them, and smile at their success.',['C']=1.017000,},[89]={['O']=18911,['N']='Fort Shadowhold',['D']='Welcome adventurers to Fort Shadowhold.\\n\\nTake a load off in the main keep, barracks are on the top floor so pick a bed and fall in. Please do refrain from touching the trophies, and be mindfull of the helpful house guests roaming the halls.\\n\\nThe chapel holds all your basic crafting needs and if you seek adventure, cast you eyes to the sky and watch your step or you may have to swim home.',['C']=1.010000,},[70]={['O']=18945,['N']='Athenaeum Azure',['D']='Delve deep into an ancient undergound, mystical Library, home to more than the secrets within it\\'s dusty pages. Seek and may you find the heart of the Khajiiti and their champions final resting place, but do not let the magic loose you among the weeds.',['C']=1.003000,},[59]={['O']=18930,['N']='Silvenars Rest',['D']='An elegant manor home for your most dearly beloved to come home too after a long day adventuring. ',['C']=1.021000,},},}"
