one journal on a desk nearby that could prove both amusing, and useful. (1)\\n\\nThere will be a few books on shelves you can find, but they are not essential to the story at all. Just simply Easter egg books with information about the land, people, faith or flora and fauna of the underdark. (I hope to continuously add more and more as time  goes by.)\\n\\nI hope you enjoy, and .. Happy Halloween!!\\n\\n(Don\\'t forget to read the first story book before going though the portal!)\\n\\n',['title']='Introduction- Please read',},['Alpha']=1,},[235]={['Roll']=0,['EffectType']=8502,['Groups']=0,['SizeX']=21.456456,['X']=15240,['SizeZ']=30,['Y']=10583,['Contrast']=1.500000,['Yaw']=3.471460,['Id']=3606,['SizeY']=30,['Pitch']=4.712564,['Color']=194574,['Z']=41493,['MetaData']={['message']='House Nilvala has requested my aid to connect them with a wizard from the surface. They have even gone so far as to embrace the surface\\'s dark holiday, to welcome this wizard. \\n\\n\\nI have chosen to send Mortali, an insufferable, pompous fool I have had the displeasure of working with before. He is quite skilled, just as requested, but I\\'m hoping his mouth might get house Nilvala to rid me of him permanently. We shall see.\\n\\n\\nMortali arrived today. I quickly sent Beilon to guide him out before I killed him myself. I had them go through the breakroom and out the back into the Underdark. \\n\\n\\nThey\\'ll have to keep to the upper pathway to the left, since poisonous gasses have built back up blocking the lower path. There are many dangers between here and the secret tunnel that leads into the library of house Nilvala. Perhaps he\\'ll never even make it to the house ... such a pity.\\n\\n\\nWe have sensed multiple magical attempts of scrying, from Tamriel, allies of Mortali I am sure. Let them come and seek him out... We will allow them to pass for now. .... after all, this could be quite amusing to watch.\\n\\n\\nAn ally of Mortali came today through a portal. From above, we watched him look around my office. ... He did not make it very far once he entered the Underdark. \\n\\n\\nToday they sent two allies of Mortali. For such a irritating human, they are persistent in finding him. They almost found the secret door, but got sidetracked by the emeralds to the North. ... Basilisks do not like to be disturbed. \\n\\n\\nAnother comes today...  We will be watching....',['title']='Jarlaxle\\'s log',},['Alpha']=1,},[236]={['EffectType']=4,['Groups']=0,['SizeX']=1080,['Roll']=0,['SizeZ']=280,['Y']=10999,['Color']=999999,['Contrast']=1,['Id']=3607,['SizeY']=280,['Pitch']=4.712564,['X']=13573,['Yaw']=4.028220,['Z']=39658,['Alpha']=1,},[237]={['EffectType']=12,['Groups']=0,['SizeX']=500,['Roll']=0,['SizeZ']=500,['Y']=10241,['Color']=0,['Contrast']=1,['Id']=3608,['SizeY']=1,['Pitch']=0,['X']=30726,['Yaw']=4.747296,['Z']=29673,['Alpha']=1,},[238]={['EffectType']=829,['Groups']=0,['SizeX']=1320,['Roll']=0,['SizeZ']=2720,['Y']=10624,['Color']=241900,['Contrast']=1,['Id']=3611,['SizeY']=2720,['Pitch']=1.570971,['X']=29225,['Yaw']=0.015708,['Z']=32760,['Alpha']=1,},[239]={['Roll']=0,['EffectType']=847,['Groups']=0,['SizeX']=470,['X']=29356,['SizeZ']=192.982456,['Y']=10105,['Contrast']=1,['Yaw']=0.261799,['Id']=3613,['SizeY']=192.982456,['Pitch']=3.141767,['Color']=530100,['Z']=30295,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Alpha']=0.040000,},[240]={['EffectType']=5053,['Groups']=0,['SizeX']=94.669405,['Roll']=0,['SizeZ']=540,['Y']=10028,['Color']=0,['Contrast']=1.320000,['Id']=3619,['SizeY']=540,['Pitch']=4.712564,['X']=29330,['Yaw']=0.048869,['Z']=29729,['Alpha']=1,},[241]={['EffectType']=832,['Groups']=0,['SizeX']=242,['Roll']=0,['SizeZ']=580,['Y']=9936,['Color']=19,['Contrast']=0.620000,['Id']=3620,['SizeY']=580,['Pitch']=4.708898,['X']=29543,['Yaw']=4.680973,['Z']=30264,['Alpha']=1,},[242]={['EffectType']=5090,['Groups']=0,['SizeX']=49.879663,['Roll']=0,['SizeZ']=50,['Y']=10029,['Color']=0,['Contrast']=1,['Id']=3626,[