']=50000,['Alpha']=1,['Contrast']=0.360000,['Pitch']=6.227335,['Z']=29467,['Groups']=0,['SizeZ']=634,['EffectType']=485,['Id']=2870,['SizeY']=634,['Roll']=0,['SizeX']=20,},[229]={['Y']=10291,['X']=30686,['Yaw']=4.712389,['Color']=111111,['Alpha']=1,['Contrast']=1,['Pitch']=0,['Z']=29675,['Groups']=0,['SizeZ']=672,['EffectType']=867,['Id']=2871,['SizeY']=672,['Roll']=0,['SizeX']=414.285714,},[230]={['Y']=9624,['X']=20192,['Yaw']=0,['Color']=31700,['Alpha']=1,['Contrast']=1,['Pitch']=1.570971,['Z']=35870,['Groups']=0,['SizeZ']=1240,['EffectType']=829,['Id']=3599,['SizeY']=1240,['Roll']=0,['SizeX']=2560,},[231]={['Y']=9664,['X']=19577,['Yaw']=0,['Color']=31500,['Alpha']=1,['Contrast']=1,['Pitch']=1.570971,['Z']=34944,['Groups']=0,['SizeZ']=1240,['EffectType']=829,['Id']=3600,['SizeY']=1240,['Roll']=0,['SizeX']=2560,},[232]={['Y']=9724,['X']=19259,['Yaw']=0,['Color']=21300,['Alpha']=1,['Contrast']=1,['Pitch']=1.570971,['Z']=35454,['Groups']=0,['SizeZ']=1240,['EffectType']=829,['Id']=3601,['SizeY']=1240,['Roll']=0,['SizeX']=2560,},[233]={['Y']=9704,['X']=19363,['Yaw']=0,['Color']=41500,['Alpha']=0.950000,['Contrast']=1,['Pitch']=1.570971,['Z']=36494,['Groups']=0,['SizeZ']=1240,['EffectType']=829,['Id']=3602,['SizeY']=1240,['Roll']=0,['SizeX']=2560,},[234]={['Yaw']=4.447099,['Y']=10633,['X']=13034,['MetaData']={['message']='\\nWelcome! \\n\\n\\nThis is a house I had originally created for a quest for our RP guild. I have since, made adjustments, so visitors to the house can also enjoy a little hint of the adventure they had!\\n\\n\\nThere are lots of spooky little nasties hiding for you to find! So keep a sharp eye out! \\n\\n\\n***\\n(If you wish to simply look around without any story, feel free to skip reading the remaining books, and just enjoy yourself. :-) )\\n\\n\\n\\n----------------------------------\\n\\n\\n\\nThose seeking the adventure:\\n\\nThere will be a few books you can find throughout this adventure.\\n\\nWatch for:\\n\\nOrange books under pumpkins: These are narrative information, that will guide you through the story\\'s progression. (7)\\n\\n*There is one journal on a desk nearby that could prove both amusing, and useful. (1)\\n\\nThere will be a few books on shelves you can find, but they are not essential to the story at all. Just simply Easter egg books with information about the land, people, faith or flora and fauna of the underdark. (I hope to continuously add more and more as time  goes by.)\\n\\nI hope you enjoy, and .. Happy Halloween!!\\n\\n(Don\\'t forget to read the first story book before going though the portal!)\\n\\n',['title']='Introduction- Please read',},['Color']=33591,['Alpha']=1,['Contrast']=0.750000,['Pitch']=4.712564,['Z']=39319,['Groups']=0,['SizeZ']=47,['EffectType']=8503,['Id']=3605,['SizeY']=47,['Roll']=0,['SizeX']=40,},[235]={['Yaw']=3.471460,['Y']=10583,['X']=15240,['MetaData']={['message']='House Nilvala has requested my aid to connect them with a wizard from the surface. They have even gone so far as to embrace the surface\\'s dark holiday, to welcome this wizard. \\n\\n\\nI have chosen to send Mortali, an insufferable, pompous fool I have had the displeasure of working with before. He is quite skilled, just as requested, but I\\'m hoping his mouth might get house Nilvala to rid me of him permanently. We shall see.\\n\\n\\nMortali arrived today. I quickly sent Beilon to guide him out before I killed him myself. I had them go through the breakroom and out the back into the Underdark. \\n\\n\\nThey\\'ll have to keep to the upper pathway to the left, since poisonous gasses have built back up blocking the lower path. There are many dangers between here and the secret tunnel that leads into the library of house Nilvala. Perhaps he\\'ll never even make it to the house ... such a pity.\\n\\n\\nWe have sensed multiple magical attempts of scrying, from Tamriel, allies of Mortali I am sure. Let them come and seek him out... We will allow them to pass for now. .... after all, this could be quite amusing to watch.\\n\\n\\nAn ally of Mortali came today through a portal. From above, we watched him look around my office. ... He did not make it very far once he entered the Underdark. \\n\\n\\nToday they sent two allies of Mortali. For such a irritating human, they are persistent in finding him. They almost found the secret door, but got sidetracked by the emeralds to the North. ... Basilisks do not like to be disturbed. \\n\\n\\nAnother comes today...  We will be watching....',['title']='Jarlaxle\\'s log',},['Color']=194574,['Alpha']=1,['Contrast']=1.500000,['Pitch']=4.712564,['Z']=41493,['Groups']=0,['SizeZ']=30,['EffectType']=8502,['Id']=3606,['SizeY']=30,['Roll']=0,['SizeX']=21.456456,},[236]={['Y']=10999,['X']=13573,['Yaw']=4.028220,['Color']=999999,['Alpha']=1,['Contrast']=1,['Pitch']=4.712564,['Z']=39658,['Groups']=0,['SizeZ']=280,['EffectType']=4,['Id']=3607,['SizeY']=280,['Roll']=0,['SizeX']=1080,},[237]={['Y']=10241,['X']=30726,['Yaw']=4.747296,['Color']=0,['Alpha']=1,['Contrast']=1,['Pitch']=0,['Z']=29673,['Groups']=0,['SizeZ']=500,['EffectType']=12,['Id']=3608,['SizeY']=1,['Roll']=0,['SizeX']=500,},[238]={['Y']=10624,['X']=29225,['Yaw']=0.015708,['Color']=241900,['Alpha']=1,['Contrast']=1,['Pitch']=1.570971,['Z']=32760,['Groups']=0,['SizeZ']=2720,['EffectType']=829,['Id']=3611,['SizeY']=2720,['Roll']=0,['SizeX']=1320,},[239]={['Yaw']=0.261799,['Y']=10105,['X']=29356,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Color']=530100,['Alpha']=0.040000,['Contrast']=1,['Pitch']=3.141767,['Z']=30295,['Groups']=0,['SizeZ']=192.982456,['EffectType']=847,['Id']=3613,['SizeY']=192.982456,['Roll']=0,['SizeX']=470,},[240]={['Y']=10028,['X']=29330,['Yaw']=0.048869,['Color']=0,['Alpha']=1,['Contrast']=1.320000,['Pitch']=4.712564,['Z']=29729,['Groups']=0,['SizeZ']=540,['EffectType']=5053,['Id']=3619,['SizeY']=540,['Roll']=0,['SizeX']=94.669405,},[241]={['Y']=9936,['X']=29543,['Yaw']=4.680973,['Color']=19,['Alpha']=1,['Contrast']=0.620000