n\\nLes Maomers sont une race de mers aussi appelés les Elfes Tropicaux, Elfes des Mers ou encore Elfes Poissons. On peut aussi se référer à eux en tant que Pyandoniens. Leur patrie se trouve dans les îles au Sud du Couchant, en Pyandonée.\\n\\nLes Efles Tropicaux sont physiquement bien différents de leurs homologues de Tamriel. Il possède des yeux particulièrement blancs, ainsi qu\\'une peau pâle et sans couleur. Si on les blesse, on pourra apercevoir une chair semblable à celle des poissons. Les Maomers possèdent aussi la capacit�� de changer leur peaux, à la manière d\\'un caméléon.\\n\\nA l\\'encontre de notre intitulé, les Maomers ne sont pas des descendants des Atlmers, mais bien comme tous les Mers, ils descendent des plus anciens Aldmers du continent d\\'Aldmérie. Les traductions des tapisseries de la Tour de Cristal nous relate l\\'histoire d\\'Orgnum, un noble Aldmer particulièrement fortuné qui utilisa ses fonds afin de se rebeller contre le pouvoir du Gouvernement d\\'Aldmeri. Un fois le complot défait, Orgnum et ses comploteurs furent bannis du continent et contraint de s\\'exiler de la terre de leurs ancêtres. Les Adlmers les envoyèrent donc en Pyandonée, afin que leurs complots ne puissent plus atteindre les ancêtres des Haut-Elfes. La particularité de ces îles résides dans leurs brumes et tempêtes magiques qui tournoient autour des îles. L\\'environnements hostile de Pyandonée changea la nature de ses Aldmers, les transformant ainsi en Maomers.\\n\\nAu travers des siècles, les Maomers essayèrent d\\'attaquer le Couchant par les mers. Bien qu\\'ils devinrent de navigateur talentueux, jamais ils ne réussirent à prendre Le Couchant si précieux aux yeux des Altmers.',['title']='La division des Altmers et Maomers, que s\\'est-il passé ?',},['Y']=10462,['Id']=1111,['Color']=102439,['SizeX']=26.456456,['SizeZ']=30,['SizeY']=30,['Groups']=0,['EffectType']=8501,},[29]={['X']=105502,['Z']=91615,['Roll']=0,['Alpha']=1,['Contrast']=1.430000,['Pitch']=0,['Yaw']=3